import pic from './logo.svg';
import { CartContext } from './CartContext';
import { useContext ,useEffect } from 'react'
function Cart() {
   const {cart}= useContext(CartContext)

   useEffect(()=>{
       fetch('/api/', {
           params: Object.keys(cart.items)
       })
       .then((res)=>{res.json()})
       .then((data)=>{
           console.log(data);
       })
   },[]);
    return ( 
       <table className="table table-success table-striped">
           <tr>
               <th>Image</th>
               <th>Product Name</th>
               <th>Quantity</th>
               <th>Price</th>
           </tr>
           <tr><img src={pic}  alt=''/></tr>
       </table>
     );
}

export default Cart;
